    data: |
      SELECT - ( col0 ) AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - col1 - col2 > - - ( 93 ) * 94 + + col1;
  - name: tab1

outputs:
  - name: q13673.out
    data: |
      -51
      -85
      -91
